import React from 'react';
import '../styles/Contact.css';

class Contact extends React.Component {
  render() {
    return (
      <div className="contact-container">
        <h1>Contact Us</h1>
        <div className="contact-form">
          {/* Add your contact form fields here */}
          <input type="text" placeholder="Name" />
          <input type="email" placeholder="Email" />
          <textarea placeholder="Message"></textarea>
          <button>Send Message</button>
        </div>
        <div className="contact-map">
          {/* Add your Google Maps component here */}
          <iframe
            title="Techbitz Location"
            src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2944.312737176217!2d-83.65944878453917!3d42.244516379194886!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x883ca173e0e8b823%3A0x328ed03e7e6db3ff!2s4609%20Cherry%20Blossom%20Dr%2C%20Ypsilanti%2C%20MI%2048197%2C%20USA!5e0!3m2!1sen!2sin!4v1626193182821!5m2!1sen!2sin"
            allowFullScreen
            loading="lazy"
          ></iframe>
        </div>
      </div>
    );
  }
}

export default Contact;
